import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer'

const coustomer = {
  'id': 1,
  'image': 'htttps://placeimg.com/64/64/any',
  'name': '킹석중',
  'birchday': '981112',
  'gender': '남자',
  'job': '대통령'
}

function App() {
  return (
    <Customer
    id={coustomer.id}
    image={coustomer.image}
    name={coustomer.name}
    birchday={coustomer.birchday}
    gender={coustomer.gender}
    job={coustomer.job}
    />
  );
}

export default App;
